function userFriendlyTransmogrify(base, listOfObjects, key, sep, prefixFirst) {
	sep = sep || " ";
    var cur = base + (prefixFirst ? (sep + 1) : '');
    var names = []
    for (var i = 0; i < listOfObjects.length; i++) {
        names.push(listOfObjects[i][key]);
    }
    i = 1;
    while (true) {
        if (names.indexOf(cur) < 0) {
            return cur
        }
        cur = base + sep + (++i)
    }
}

